import React from 'react'
import { connect } from 'react-redux'

class CustomerEdit extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            email: '',
            password: ''
        }
    }
    render() {
        console.log(this.props.order)
        return (
            this.props.order ? (
                <div className="container p-5" style={{width: '500px'}}>
                    <form>
                        <div className="form-group">
                            <label htmlFor="exampleInputEmail1">Email address</label>
                            <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email address" />
                        </div>
                        <div className="form-group">
                            <label htmlFor="exampleInputPhone">Phone</label>
                            <input type="phone" className="form-control" id="exampleInputPhone" placeholder="Enter mobile number" />
                        </div>
                        <button type="submit" className="btn btn-primary">Save</button>
                    </form>
                </div>
            ) : ''
        )
    }
}

const mapStateToProps = (state, props) => {
    return {
        order: state.orders.find(order => order._id === props.match.params.id )
    }
}

export default connect(mapStateToProps)(CustomerEdit)
